import Perfil from "../Img/fotoFondo.jpg";
import "./Content.css";
import HomeAnimation from "../Animation/HomeAnimation.js";
const Content = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col d-none d-lg-block col-md-4 h-img-full text-center pt-5">
          <img src={Perfil} alt="perfil" className="img-fluid" />
          <p className="fs-2 me1">Ricardo Ramirez</p>
          <p className="fs-4 me1 text-front">web developer</p>

          {/* <i className="icons bi bi-linkedin"></i>
          <i className="icons bi bi-github mx-1"></i>
          <i className="icons bi bi-youtube mx-1"></i> */}
          <button
            type="button"
            className="col-6 btn btn-outline-warning btn-sm mt-5 mb-5"
          >
            <i class="bi bi-cloud-arrow-down-fill ">&nbsp;Download&nbsp;C.V</i>
          </button>
        </div>
        <div className="col">
          <div className="row">
            <div className="col-12 me1 bg-black text-center p-3">
              <HomeAnimation />
            </div>
            <div className="col bg-success">
              <span className="me1">
                Hello , my name is
                <small className="ricardo  fs-2"> Ricardo Ramirez</small>
              </span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Content;
